import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Navbar as NavbarBs} from 'react-bootstrap';




export default function Navbar() {
  return (

    <nav className="fixed-top bg-white border-gray-200 dark:bg-gray-900 border-b border-color-blue-900">
      <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto">
        <a href="/" className="flex items-center">
            <span className="self-center text-2xl font-semibold whitespace-nowrap dark:text-white">APAMSA</span>
            <img src="/images/image-logo-small-dark.png" className="h-8 ml-3" alt="Logo" />
        </a>

      </div>
    </nav>

  );
}
